package main

import (
	"fmt"
	"sort"
	"testing"

	"github.com/stretchr/testify/assert"
)

func TestNeighborsStr(t *testing.T) {
	assert.Equal(t,
		[]string{"ACG", "CCG", "GCG", "TCG", "AAG", "AGG", "ATG", "ACA", "ACC", "ACT"},
		NeighborsStr("ACG", 1))
}

func TestNeighborsSimple(t *testing.T) {
	expected := []string{"ACA", "ACC", "AAG", "ACG", "CCG", "GCG", "TCG", "AGG", "ATG", "ACT"}
	sequenceList := sequences(NeighborsSimple(NormalizeDNA("ACG"), 1))

	dnaStrains := sequenceList.Denormalize()
	sort.Strings(dnaStrains)
	sort.Strings(expected)

	assert.Equal(t, expected, dnaStrains)
}

func TestIterativeNeighbors(t *testing.T) {
	expected := []string{"ACA", "ACC", "AAG", "ACG", "CCG", "GCG", "TCG", "AGG", "ATG", "ACT"}
	sequenceList := sequences(IterativeNeighbors(NormalizeDNA("ACG"), 1))

	dnaStrains := sequenceList.Denormalize()
	sort.Strings(dnaStrains)
	sort.Strings(expected)

	assert.Equal(t, expected, dnaStrains)
}

func TestNeighborsSimpleLonger(t *testing.T) {
	sequenceList := sequences(NeighborsSimple(NormalizeDNA("TCGGCTTA"), 2))

	dnaStrains := sequenceList.Denormalize()
	assert.Equal(t, []string{"ACA", "ACC", "AAG", "ACG", "CCG", "GCG", "TCG", "AGG", "ATG", "ACT"}, dnaStrains)

	for i := range dnaStrains {
		fmt.Println(dnaStrains[i])
	}
}

func TestHammingDistance(t *testing.T) {
	assert.Equal(t, 3, HammingDistanceStr("GGGCCGTTGGT", "GGACCGTTGAC"))
	assert.Equal(t, 780, HammingDistanceStr(dataset_6_12321, dataset_6_12322))
	assert.Equal(t, 23, HammingDistanceStr("CAGAAAGGAAGGTCCCCATACACCGACGCACCAGTTTA", "CACGCCGTATGCATAAACGAGCCGCACGAACCAGAGAG"))
	assert.Equal(t, 36, HammingDistanceStr("CTACAGCAATACGATCATATGCGGATCCGCAGTGGCCGGTAGACACACGT", "CTACCCCGCTGCTCAATGACCGGGACTAAAGAGGCGAAGATTATGGTGTG"))
}

