	assert.Equal(t,
		[]int{4, 5, 6, 7, 8, 11, 12, 13, 14, 15},
		NaiveApproximateSubString("TTTTTTAAATTTTAAATTTTTT", "AAA", 2))

	assert.Equal(t,
		[]int{0, 30, 66},
		NaiveApproximateSubString("GAGCGCTGGGTTAACTCGCTACTTCCCGACGAGCGCTGTGGCGCAAATTGGCGATGAAACTGCAGAGAGAACTGGTCATCCAACTGAATTCTCCCCGCTATCGCATTTTGATGCGCGCCGCGTCGATT", "GAGCGCTGG", 2))

	assert.Equal(t,
		[]int{3, 36, 74, 137},
		NaiveApproximateSubString("CCAAATCCCCTCATGGCATGCATTCCCGCAGTATTTAATCCTTTCATTCTGCATATAAGTAGTGAAGGTATAGAAACCCGTTCAAGCCCGCAGCGGTAAAACCGAGAACCATGATGAATGCACGGCGATTGCGCCATAATCCAAACA", "AATCCTTTCA", 3))

